  def maxKDistinct(self, nums: List[int], k: int) -> List[int]:
    nums = list(set(nums))
    nums.sort(key=lambda i: -i)
    return nums[0: k]

class Solution:
    def maxKDistinct(self, nums: List[int], k: int) -> List[int]:
        res = []
        nums.sort()
        while len(res) < k and nums:
            x = nums.pop()
            if not res or x != res[-1]:
                res.append(x)
        return sorted(res,reverse=True)
